import {Link} from "react-router-dom"
import React, { useState } from 'react';

function StudentProjectForm(Submit, error){
    const [details, setDetails] = useState({name:"", ddl1: "", ddl2: "", ddl3: "", link1: "", link2: "", link3:""});

    function submitHandler(e){
        e.preventDefault();

        Submit(details);
    }
    return (
        <form onSubmit={submitHandler}>
            <div className="form-inner">
                <h2>Login</h2>
                {(error != "") ? ( <div className="error">{error}</div>) : ""}
                <div className="form-group">
                    <label htmlFor="name">Project Name: </label>
                    <input type="text" name="name" id="name" onChange={e=>setDetails({...details, name: e.target.value})} value={details.name}/>
                </div>
                <div className="form-group">
                    <label htmlFor="ddl1">Deadline 1: </label>
                    <input type="text" name="ddl1" id="ddl1" onChange={e=>setDetails({...details, ddl1: e.target.value})} value={details.ddl1}/>
                </div>
            </div>
            <input type="submit" value="LOGIN"/>
        </form>
        
    )
    }
export default StudentProjectForm
